import {useEffect, useState} from "react";
import axios from "axios";

function App() {
  const [hello, setHello] = useState('');

  useEffect(() => {
    axios.get('/api/test')
        .then((res) => {
          setHello(res.data);
        })
  }, []);
  return (
      <div className="App">
        드디어 성공 : {hello}
      </div>
  );
}

export default App;
